import React, { Component } from 'react';

class About extends Component {
  render() {

    if(this.props.data){
      var name = this.props.data.name;
      var profilepic= "images/"+this.props.data.image;
      var bio = this.props.data.bio;
      var city = this.props.data.address.city;
      var state = this.props.data.address.state;
      var zip = this.props.data.address.zip;
      var phone= this.props.data.phone;
      var email = this.props.data.email;
      var resumeDownload = this.props.data.resumedownload;
      var education = this.props.data.education.map(function(education){
         return <div key={education.school}>
                  <h3>{education.school}</h3>
                  <p className="info">{education.degree} <span>&bull;</span><em className="date">{education.graduated}</em></p>
               </div>
       });
    }

    return (
      <section id="about">
      <div className="row">
         <div className="three columns">
            <img className="profile-pic"  src={profilepic} alt="Xinyu Profile Pic" />
         </div>
         <div className="nine columns main-col">
            <h1><span>Education</span></h1>
            <div className="twelve columns">
               {education}
            </div>



            <h2>About Me: Software Engineer X Data Scientist</h2>

            <p>I am Xinyu Dai, currently a master candidate in Computer Science at Northeastern University, Seattle. I got my Data Science Degree from Worcester Polytechnic Institute in 2017. </p>
            <p>I love to keep up with the fast pace of technological changes and various data driven applications in different industries. The process of training the data science models, building up pipelines to prepare and learn data from the real world is really fascinating for me. I would love to accumulate hands on experiences on developing high scalable services. </p>
            <div className="row">
               <div className="columns contact-details">
                  <h2>Contact Details</h2>
                  <p className="address">
						   <span>{name}</span><br />
						   <span>{city}<br />
						         {state}, {zip}
                   </span><br />
						   <span>{phone}</span><br />
                     <span><a href="mailto:tbakerx@gmail.com">{email}</a></span>
					   </p>
               </div>
               <div className="columns download">
                  <p>
                     <a href={resumeDownload} className="button" target="_blank"><i className="fa fa-download"></i>Download Resume</a>
                  </p>
               </div>
            </div>
         </div>
      </div>

   </section>
    );
  }
}

export default About;
